const customerData = [
    {
        path : 'customerProfile',
        name : 'عرض المعلومات',
        icon : 'fa-solid fa-user'
    },
    {
        path : 'customerTransiction',
        name : 'تحويل اموال',
        icon : 'fa-solid fa-arrow-up-from-bracket'
    },
    {
        path : 'transfer',
        name : 'تحويل ',
        icon : 'fa-solid fa-arrow-up-from-bracket'
    },
    {
        path : 'historyTransiction',
        name : 'سجل التحويلات',
        icon : 'fa-solid fa-clock-rotate-left'
    },
    {
        path : 'myAccountInfo',
        name : 'معلومات الحساب',
        icon : 'fa-solid fa-credit-card'
    },
]
export default customerData;
